Information
------------------------------

First Australians
First Australians chronicles the birth of contemporary Australia as never told before, from the perspective of its first people. First Australians explores what unfolds when the oldest living culture in the world is overrun by the world's greatest empire. Over seven episodes, First Australians depicts the true stories of individuals - both black and white - caught in an epic drama of friendship, revenge, loss and victory in Australia's most transformative period of history.
The story begins in 1788 in Sydney, with the friendship between an Englishmen (Governor Phillip) and a warrior (Bennelong) and ends in 1993 with Koiki Mabo's legal challenge to the foundation of Australia. First Australians chronicles the collision of two worlds and the genesis of a new nation.




5)  An Unhealthy Government Experiment 
Jandamurra is born on a cattle station in the Kimberley in 1870s. His hybrid life takes a bloody turn when he trades in his status as a police tracker for his own people. Gladys Gilligan is one of more than 50,000 half-caste children plucked from her family and sent to a mission. The Chief Protector of Aborigines, AO Neville, institutionalises her first son, orders her to be arrested, and denies her the right to marry three times, but she remains resolutely independent.



